import React from 'react';
import "./App.css";
import Homepage from "./pages/homepage/homepage.component";
import {Route} from 'react-router-dom';

const HatsPage = () => (
  <div>
    <h1>HATS PAGE</h1>
  </div>
);


function App() {
  return (
    <div>
      <Route exact={false} path='/' component={Homepage}/>
      <Route exact={false} path='/hats' component={HatsPage}/>
    </div>
  );
}

export default App;
